import UserAvatar from "../components/UserAvatar";

export default function PostCard({ post }) {
  //prop er post, kunne kaldes alt mulig. skal matche med det data der hentes fra firebase.
  return (
    <>
      {post.image && (
        <article>
          <UserAvatar uid={post.uid} />
          <img src={post.image} alt={post.title} />
          <h2>{post.title}</h2>
          <p>{post.body}</p>
        </article>
      )}
    </>
  );
}
